import React from 'react';

class Home extends React.Component {
    render(){
        return (
            <div>
              <section className="alt-sec">
                <div className="container">
                  <div className="image-part">
                    <img></img>
                  </div>
                  <div className="content-part">
                    <h1></h1>
                  </div>
                </div>
              </section>
            </div>
              );
    }
}

export default Home;
